(2, 'BharatMatrimony Office Add', '<p><strong>BharatMatrimony Offices</strong>&nbsp; Our customer centric content development and outreach programs help e-commerce clients generate repeat purchases thereby making every customer more profitable. Starting with how-to guides right up till loo</p>\r\n', 'etest seo title', 'etest seo meta', 'etest seo kaywords', 'bharatmatrimony-offi'),
(3, 'Doorstep Payment Facility', '<p>Doorstep Payment Facility description One of the fastest growing and most promising industries, e-commerce brought the world at the forefront of online revolution and has even played a key role in redefining supply chain and door-to-door delivery. But ', 'test seo title', 'test seo meta', 'test seo kaywords', 'doorstep-payment-fac'),
(5, 'About Us', '<p>Welcome to the profound world of Findmyjodi.com, world&rsquo;s first Social Networking Matrimonial Site. Findmyjodi.com renders its services under its parent company S.R.C. Matrimony Pvt. Ltd.</p>\r\n\r\n<p>The site provides features to know the social aspects of a person, which is crucial part of deciding the marriage in the current generation.</p>\r\n\r\n<p>Our side provides an ample database of profiles to search. We are immensely known for the perfect matchmakings, handy navigation and commendable services. Our site gives search options for prospective bride or bridegroom on the basis of various categories such as mother tongue, country, religion, caste, occupation etc. from the large database of profiles.</p>\r\n\r\n<p>In order to expand our growth further, our team of dedicated and proficient professionals has brought innovative technologies, improved user-friendly navigation and cooperative approach in our day-to-day functioning. We use some of the ultra-modern and commendable technologies to facilitate efficient as well as agile search. Furthermore all the necessary steps are taken in order to ensure that the searches result in concrete and best suited profiles only.</p>\r\n', 'About Us - Find My Jodi', 'About Us - Find My Jodi,Findmyjodi.com,Matrimonial', 'About Us - Find My Jodi,Findmyjodi.com,Matrimonial', 'about-us'),
