(26, 'Contact Us', '<h1>Contact Us</h1>\r\n\r\n<p>Customer Service Help line:</p>\r\n\r\n<p><span class="skype_c2c_container" dir="ltr" tabindex="-1"><span class="skype_c2c_highlighting_inactive_common" dir="ltr"><span class="skype_c2c_textarea_span"><img class="skype_c2c_logo_img" src="resource://skype_ff_extension-at-jetpack/skype_ff_extension/data/call_skype_logo.png" /><span class="skype_c2c_text_span">+91 9886355564</span></span></span></span></p>\r\n\r\n<p>Office Hours 8:00 AM to 6:00 PM (IST)<br />\r\n<span>[Sunday Holiday]</span></p>\r\n\r\n<div class="skype_c2c_menu_container" id="skype_c2c_menu_container" onmouseout="SkypeClick2Call.MenuInjectionHandler.hideMenu(event)" onmouseover="SkypeClick2Call.MenuInjectionHandler.showMenu(this, event)" style="display: none;">\r\n<div class="skype_c2c_menu_click2call"><a class="skype_c2c_menu_click2call_action" id="skype_c2c_menu_click2call_action">Call</a></div>\r\n\r\n<div class="skype_c2c_menu_click2sms"><a class="skype_c2c_menu_click2sms_action" id="skype_c2c_menu_click2sms_action">Send SMS</a></div>\r\n\r\n<div class="skype_c2c_menu_add2skype"><a class="skype_c2c_menu_add2skype_text" id="skype_c2c_menu_add2skype_text">Add to Skype</a></div>\r\n\r\n<div class="skype_c2c_menu_toll_info"><span class="skype_c2c_menu_toll_callcredit">You&#39;ll need Skype Credit</span><span class="skype_c2c_menu_toll_free">Free via Skype</span></div>\r\n</div>\r\n', 'Contact Us', 'Contact Us', 'Contact Us', 'contact-us'),
(27, 'Privacy Policy', '<p>Findmyjodi.com is an online matrimonial portal endeavoring to provide its customers with matrimonial services to best of its abilities to deliver best quality services.</p>\r\n\r\n<p>We are strongly committed to your right to privacy;the below privacy statement is drawn with regard to the information we collect from you.</p>\r\n\r\n<p>We use a secure server for credit card transactions to protect the credit card information of our users and Cookies are used to store the login information.</p>\r\n\r\n<p>The information we gather from members and visitors who register for the various services our site offers includes, but may not be limited to, email address, first name, last name, a user-specified password, mailing address, zip code and telephone number etc.</p>\r\n\r\n<p>The information collected from any of our users is not shared with any individual or organization without the former&#39;s approval.Ã¢â‚¬Â¨Findmyjodi.com does not sell, rent, or loan any identifiable information at the individual level regarding its customers to any third party. Any information provided to us is held with the utmost care and security. We are also bound to cooperate fully should a situation arise where we are required by law or legal process to provide information about a customer.</p>\r\n\r\n<p>In any case, if a member wishes to unsubscribe, then he/she may do so by logging into the account.</p>\r\n', 'Privacy Policy - Find My Jodi', 'Privacy Policy - Find My Jodi', 'Privacy Policy - Find My Jodi', 'privacy-policy');
