(28, 'Terms and conditions', '<p><strong>Dear Esteemed Member,</strong></p>\r\n\r\n<p>We graciously welcome you to the family of findmyjodi.com. We would like to thank you for choosing findmyjodi.com to find a suitable and best life partner and we wish you all the best.</p>\r\n\r\n<p>BEFORE REGISTERING PLEASE READ THE FOLLOWING TERMS AND CONDITIONS CAREFULLY. BY USING THE FINDMYJODI.COM WEBSITE, YOU AGREE TO BE BOUND BY THESE TERMS AND CONDITIONS.</p>\r\n\r\n<p>Members of findmyjodi.com are granted a nonexclusive and limited license to use and access the content and services offered in accordance with the following Terms and Conditions. Findmyjodi.com holds the right to change the below agreement from time to time.</p>\r\n\r\n<p><br />\r\n<strong>Membership Conditions: -</strong><br />\r\n1. To register as a member of Findmyjodi.com or use this Site, you must be of legal marriageable age as per the laws of country in which you are currently resides and as per the law of country you are citizen of. The Findmyjodi.com Site is only to facilitate lawful marriages between persons who are legally competent to enter into matrimony under the laws to which they are subject. Your Account will be terminated and all members services will be void where prohibited. By using this Site, you represent and warrant that you have the right, authority, and legal capacity to enter into this Agreement and that you are not prohibited or prevented by any applicable law for the time being in force or any order or decree or injunction from any court, tribunal or any such competent authority restraining you from entering into matrimony. You also agree to abide by all of the terms and conditions of this Agreement. If at any time Findmyjodi.com, is of the opinion (in its sole discretion) or has any reason to believe that you are not eligible to become a member or that you have made any misrepresentation about your eligibility, Findmyjodi.com reserves the right to forthwith terminate your account and / or your right to use the Service.&nbsp;</p>\r\n\r\n<p><br />\r\n2. You may terminate your account at any time, for any reason by writing to Findmyjodi.com, after logging in to site using your credentials. Findmyjodi.com also reserves the rights to terminate your account/ remove profile/ block access to the Site with or without sending notice. Even after this Agreement is terminated, certain provisions will remain in effect inclusive, of this Agreement.&nbsp;</p>\r\n\r\n<p><br />\r\n3. Findmyjodi.com reserves the right in it&#39;s sole discretion to review the activity &amp; status of each account &amp; block/ discontinue/ remove the account/ profile of a member based on such review. Findmyjodi.com reserves the right to screen communications/messages that you may send to other Member(s) and also regulate the same by deleting and or editing unwarranted/ obscene communications at any time at its sole discretion without prior notice to any Member.&nbsp;<br />\r\n<br />\r\n4. Content Posted on the Site.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>You understand and agree that Findmyjodi.com may delete any content, messages, photos or profiles that in the sole judgment of Findmyjodi.com.</li>\r\n	<li>With respect to Content you submit or make available for inclusion on publicly accessible areas of the Site including but not limited to your contact details, you hereby unconditionally and irrevocably grant to Findmyjodi.com the license to use, distribute, reproduce, modify, adapt, publicly perform and publicly display such Content on the Site and to Findmyjodi.com Offline Centre&#39;s.</li>\r\n	<li>You are solely responsible for the Content that you publish or display (hereinafter, &quot;post&quot;) on the Findmyjodi.com Site or transmit to other Findmyjodi.com Members. Findmyjodi.com reserves the right to verify the authenticity of Content posted on the Site. In exercising this right, Findmyjodi.com may ask you to provide any documentary or other form of evidence supporting the Content you post on the Site. If you fail to produce such evidence, Findmyjodi.com may, in its sole discretion, terminate your account.</li>\r\n	<li>By posting Content to any public area of Findmyjodi.com, you automatically grant, and you represent and warrant that you have the right to grant, to Findmyjodi.com, and other Findmyjodi.com Members, an irrevocable, perpetual, non-exclusive, fully-paid, worldwide license to use, copy, perform, display, and distribute such information and content and to prepare derivative works of, or incorporate into other works, such information and content, and to grant and authorize sublicenses of the foregoing.</li>\r\n</ul>\r\n\r\n<p><br />\r\nThe following is an indicative list of the kind of Content that is illegal or prohibited on the Site. By posting any illegal content listed below, you are responsible for any legal action and would also require to pay full damages to Findmyjodi.com. Illegal and prohibitive Content includes Content, which are:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Offensive to the community, such as Content that promotes racism, bigotry, hatred or physical harm of any kind against any group or individual;</li>\r\n	<li>Harasses or advocates harassment of another person;</li>\r\n	<li>Promotes information that you know is false, misleading or promotes illegal activities or conduct that is abusive, threatening, obscene, defamatory or libelous;</li>\r\n	<li>Promotes an illegal or unauthorized copy of another person&#39;s copyrighted work.</li>\r\n	<li>Provides material that exploits people under the age of 18 in a sexual or violent manner, or solicits personal information from anyone under 18;</li>\r\n	<li>Provides instructional information about illegal activities such as making or buying illegal weapons, violating someone&#39;s privacy, or providing or creating computer viruses.</li>\r\n</ul>\r\n\r\n<p><br />\r\n5. You cannot post, distribute, or reproduce in any way any copyrighted material, trademarks, or other proprietary information without obtaining the prior written consent of the owner of such proprietary rights. Without limiting the foregoing, if you believe that your work has been copied and posted on the Findmyjodi.com in a way that constitutes copyright infringement, then please provide us with the following information: an electronic or physical signature of the person authorized to act on behalf of the owner of the copyright interest; a description of the copyrighted work that you claim has been infringed; a description of where the material that you claim is infringing is located on our Site; your address, telephone number, and email address; a written statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent, or the law; a statement by you, made under penalty of perjury, that the above information in your Notice is accurate and that you are the copyright owner or authorized to act on the copyright owner&#39;s behalf.&nbsp;<br />\r\n<br />\r\n6. Member Disputes. You are solely responsible for your interactions with other Findmyjodi.com Members. Findmyjodi.com reserves the right, but has no obligation, to monitor disputes between you and other Members. Findmyjodi.com also reserves the right to take appropriate action against errant members. However, Findmyjodi.com is not obliged to share such action with other members, including complainants. Findmyjodi.com expressly disclaims any responsibility or liability for any transactions or interactions between the members.<br />\r\n<br />\r\n7. Privacy:- At Findmyjodi.com, the privacy of our visitors is of extreme importance to us. This section outlines the types of personal information is received and collected by Findmyjodi.com and how it is used. Findmyjodi.com is an online matrimonial service designed to provide an easy way for our members to meet each other on the Web. To accomplish this, our members create their own unique profiles and our site search technology provides them matches based on their pre-selected criteria. In order to do this, we ask for certain personal information, which is displayed on the site. (This information includes physical / mental disability.)</p>\r\n\r\n<p>There are two types of user-submitted information we collect: Public and Private. We define Public information as personal information that may be displayed on the site at the behest of the member, such as name, gender, age, height, telephone number, photograph, etc. Private information is defined as any information that allows others to contact a user other than through Findmyjodi.com or allows the collection of information about the user other than what is displayed on the site. Of course, all Findmyjodi.com visitors may browse the site, search member profiles and view your profile details and/or other information that you have shared on our publicly viewable area of our site. Your private information is shared to other members/visitor of Findmyjodi.com based on privacy settings options you have selected. Please do not enter any information that you would not like to display any member/visitor.</p>\r\n\r\n<p>Findmyjodi.com also allows members to submit public and private information on behalf of others - child/ward, sibling, friend or marriage bureau. If such child/ward, sibling, friend or marriage bureau does not wish this information to be displayed, she/he has the option to request removal of such information after providing the necessary evidence that the information pertains to her/him.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>We use your computer/server, IP address, and browser-type related information in the general administration of our website. We may store member login ids of users and their IP addresses for certain activities they perform for security purposes in order to track down the person in case of illegal activities.</li>\r\n	<li>Google Analytics and Log Files - Like many other Web sites, Findmyjodi.com makes use of Google Analytics and log files to collect information that is not personally identifiable, such as browser type and IP address. This information is gathered for all users to the site.</li>\r\n	<li>Cookies - Findmyjodi.com uses cookies to store information about visitors preferences, record user-specific information on which pages the user access or visit, customize Web page content based on visitors browser type or other information that the visitor sends via their browser.\r\n	<ul>\r\n		<li>DoubleClick DART Cookie</li>\r\n		<li>Google, as a third party vendor, uses cookies to serve ads on Findmyjodi.com.</li>\r\n		<li>Google&#39;s use of the DART cookie enables it to serve ads to users based on their visit to Findmyjodi.com and other sites on the Internet.</li>\r\n		<li>Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy at the following URL - http://www.google.com/privacy_ads.html</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Advertising Partners - Some of our advertising partners may use cookies and web beacons on our site. These third-party ad servers or ad networks use technology to the advertisements and links that appear on Findmyjodi.com send directly to your browsers. They automatically receive your IP address when this occurs. Other technologies ( such as cookies, JavaScript, or Web Beacons ) may also be used by the third-party ad networks to measure the effectiveness of their advertisements and / or to personalize the advertising content that you see. Findmyjodi.com has no access to or control over these cookies that are used by third-party advertisers. It is possible to opt out of some, but not all, of these cookies in one location at the NAI opt-out website at (http://www.networkadvertising.org/managing/opt_out.asp) You should consult the respective privacy policies of these third-party ad servers for more detailed information on their practices as well as for instructions about how to opt-out of certain practices. Findmyjodi.com&#39;s privacy policy does not apply to, and we cannot control the activities of, such other advertisers or web sites. If you wish to disable cookies, you may do so through your individual browser options. More detailed information about cookie management with specific web browsers can be found at the browsers&#39; respective websites. When you express interest or send message to any member we do send your name and email information to person you are expressing interest or sending message. This will allow members you are interested in to contact you directly.&nbsp;</p>\r\n\r\n<p><br />\r\n8. Disclaimers. Findmyjodi.com is not responsible for any incorrect or inaccurate Content posted on the Site or in connection with the Findmyjodi.com Service, whether caused by Users, Members or by any of the equipment or programming associated with or utilized in the Service, nor for the conduct of any User and/or Member of the Findmyjodi.com Service whether online or offline. Findmyjodi.com assumes no responsibility for any error, omission, interruption, deletion, defect, delay in operation or transmission, communications line failure, theft or destruction or unauthorized access to, or alteration of, User and/or Member communications or any communications by Findmyjodi.com to its Members. Findmyjodi.com is not responsible for any problems or technical malfunction of any telephone network or lines, computer on-line-systems, servers or providers, computer equipment, software, failure of email or players on account of technical problems or traffic congestion on the Internet or at any web site or combination thereof, including injury or damage to Users and/or Members or to any other person&#39;s computer related to or resulting from participating or downloading materials in connection with the Findmyjodi.com Site and/or in connection with the Findmyjodi.com Service. Under no circumstances will Findmyjodi.com be responsible for any loss or damage resulting from anyone&#39;s use of the Site or the Service and/or any Content posted on the Findmyjodi.com Site or transmitted to Findmyjodi.com Members. The exchange of matrimonial profile(s) through or by &quot;Findmyjodi.com&quot; is not a matrimonial offer and/or recommendation from/by Findmyjodi.com. Findmyjodi.com shall not be responsible for any loss or damage to any individual arising out of, or subsequent to, any relations (including but not limited to matrimonial relations) established pursuant to the use of Findmyjodi.com. The Site and the Service are provided &quot;AS-IS&quot; and Findmyjodi.com expressly disclaims any warranty of fitness for a particular purpose or non-infringement. Findmyjodi.com cannot guarantee and does not promise any specific results from use of the Site and/or the Findmyjodi.com Service.&nbsp;</p>\r\n\r\n<p><br />\r\nFindmyjodi.com expressly disclaims any liability or responsibility whatsoever and howsoever arising as a result of any Content posted on the Site / made available to Findmyjodi.com by any Members or the users of the Site or any third party. Findmyjodi.com does not assume any responsibility or liability for any illegal Content posted on the Site by any Members, users or any third party. All liability, whether civil or criminal arising out of any Content that is Posted on the Site will be of that Member / user / third party who has Posted such Content and Findmyjodi.com reserves its right to claim damages from such Member/ user / third party that it may suffer as a result of such Content Posted on the Site. Findmyjodi.com does not claim ownership of Content you submit or make available for inclusion on the Service.</p>\r\n\r\n<p>9. Limitation on Liability. In no event will Findmyjodi.com be liable to you or any third person for any indirect, consequential, exemplary, incidental, special or punitive damages, including also lost profits arising from your use of the Site or the Findmyjodi.com Service, even if Findmyjodi.com has been advised of the possibility of such damages. Notwithstanding anything to the contrary contained herein, Findmyjodi.com&#39;s, liability to you for any cause whatsoever, and regardless of the form of the action, will at all times be limited to the amount paid, if any, by you to Findmyjodi.com, for the Service during the term of your account.&nbsp;<br />\r\n<br />\r\n10. Disputes. If there is any dispute about or involving the Site and/or the Service, by using the Site, you unconditionally agree that all such disputes and/or differences will be governed by the laws of India and shall be subject to the exclusive jurisdiction of the Competent Courts in Bangalore, India only.&nbsp;</p>\r\n\r\n<p><br />\r\n11. Indemnity. You agree to indemnify and hold Findmyjodi.com, its subsidiaries, affiliates, officers, agents, and other partners and employees, fully indemnified and harmless from any loss, liability, claim, or demand, including reasonable attorney&#39;s fees, made by any third party due to or arising out of your use of the Service in violation of this Agreement and/or arising from a breach of these Terms of Use and/or any breach of your representations and warranties set forth above and/or any fraudulent act on your part.&nbsp;</p>\r\n\r\n<p><br />\r\n12. Other. By becoming a Member of the Findmyjodi.com service, you agree to receive certain specific email from Findmyjodi.com and/or its group sites. You can unsubscribe at any time for any reason quickly and easily by clicking on the unsubscribe link enclosed in the mail. You can also manage your subscription to these emails. You hereby confirm that as on date of registration, you have not registered yourselves on the Do Not Disturb (DND) subscriber list with any telecom operator / authority. In the event, you register yourselves as a Do Not Disturb (DND) subscriber, you hereby confirm that you do not have any objection to receive messages (promotional or otherwise) from Findmyjodi.com or any of its affiliate companies. This Agreement, accepted upon use of the Site and further affirmed by becoming a Member of the Findmyjodi.com service, contains the entire agreement between you and Findmyjodi.com regarding the use of the Site and/or the Service. If any provision of this Agreement is held invalid, the remainder of this Agreement shall continue in full force and effect.&nbsp;<br />\r\n<br />\r\nBy becoming a member of Findmyjodi.com and/or using the Services of the Site, you unconditionally and irrevocably confirm that you have read the above provisions and agree to abide by them.&nbsp;</p>\r\n', 'Terms and conditions', 'Terms and conditions', 'Terms and conditions', 'terms-and-conditions');
