(1651, 'FMJ01651', 'Myself', 'Mrinal Kumar', 'M', '1987-08-14', '', '', '', '27', '9', 3, 'Software Professional', 'Private', '', '', '', 'Bharadwaj', '', '', '', 'Dont Know', '25', '70 kg', '', '', 'Middle', 'nuclear', '', '', '', '1', '1', 'Wheatish', '', '', '', '', 'UnMarried', 'Hindu', 'Hindi', 'Brahmin - Bhumihar', 'BANGALORE', 'India', '+91', '7760078301', 'mrinalcse@yahoo.com', '', '34be90983c990cf96565f2de97519b66', 'Active', 'N', '2014-06-14', '14', '06', '2014', 'Y', 'N', 'I did my schooling in DPS,Patna and then did my Btech from Sir M Visvesvaraya Institute of Technology,Bangalore. I passed out with 73% in Btech,93 in 10th and 90 in 12th and was placed in an Investment Bank-- Societe Generale. After working there for 2 years i joined Accenture Services,Bangalore where i am currently employed as an Automation Developer.  More about my work is we are currently involved in the development of the worlds first back Office trade system from Accenture, It is a very good project and has a very bright future and a lot of opportunities.However the work pressure is more as of now, it might subsidize in the future. i have received various awards in my company for my skills and msot probably will continue to do it.  Coming to my Personal Interest.  I love to spend time de-stressing myself. i love watching movies,english series and reading Novels. on my weekends i often go out biking outskirts and explore new areas.. when in free time at home i play Guitar and listen to songs. All in all i just live each moment of my life. i have won many medals in cycling,running,guitar performance and all the sport activities like volleyball,swimming,cricket,table tennis and few more.  Coming to my Family: My dad is a Bank Manager in Central Bank of India My Mom is a lecturer in patna Collegiate My sister is a Doctor My Jiaji is a Doctor My Brother is an Manager in Idea My Bhabhi is a Software Engineer in Accenture', '0000-00-00', 'Athletic', 'N', 'moderate', '', 'N', 'N', 'KARNATA